Hello STS developers

I have read:

* [request mappings view doesn't respect @GetMapping, @PostMapping etc. #101](https://github.com/spring-projects/spring-ide/issues/101)

Now I am working with:

```
Spring Tool Suite 

Version: 3.9.1.RELEASE
Build Id: 201710111105
Platform: Eclipse Oxygen.1a (4.7.1a)
```
Thus for a `Spring Framework` Web Application working with `Gradle` through _multi-modules_, for a module named `web-29-controller`, right click -> `Spring Tools` -> `Add Spring Project Nature`

For that module I have:

```
@Configuration
@RequestMappingsViewProfile
@ComponentScan(basePackages="com.manuel.jordan.controller")
public class RequestMappingsViewConfig {

	@Bean
	public String requestMappingsView(){
		throw new RuntimeException("This @Configuration with @Bean NEVER must be created in runtime");
	}

}
```

Where `@RequestMappingsViewProfile` applies to the `request-mappings-view` profile

Thus the following is mandatory:

* `web-29-controller`, right click -> `Properties` 

and then

**First Tab**
![01](https://user-images.githubusercontent.com/2552795/34005286-7582f354-e0c8-11e7-9bd5-68f621e7c44b.png)

**Third Tab**
![02](https://user-images.githubusercontent.com/2552795/34005287-75a280d4-e0c8-11e7-9662-00cd58abbd45.png)

**Second Tab**
![03](https://user-images.githubusercontent.com/2552795/34005288-75c48fd0-e0c8-11e7-9e61-03c577b037ed.png)
![04](https://user-images.githubusercontent.com/2552795/34005289-75e2defe-e0c8-11e7-9f1a-b99b39241dd0.png)

**RequestMapping View**
![05](https://user-images.githubusercontent.com/2552795/34005290-7601d11a-e0c8-11e7-82b4-5fb19e9473f8.png)

Why according with the previous figure all the `Resource URL` have the `/` value?
For the selected item I expect see `/locale/changelocale`, it according the following code

```
@Controller
@RequestMapping(path="/locale")
public class LocaleController {

	...

	/**
	 * Inform the new current locale established by the user.
	 *
	 * @param model for internal view purposes
	 * @return view location
	 */
	@GetMapping(path="/changelocale")
	public String changeLocale(Model model){
         ...	
        }

}
```

Not sure what is wrong or missing

My pointcus:
```
package com.chamc.boot.bpm.config;

import org.aspectj.lang.annotation.Pointcut;

import com.chamc.boot.bpm.model.param.AddSignParam;

public class Pointcuts {
	
	@Pointcut("execution(public * com.chamc.boot.bpm.controller.TaskController.addSign(..)) && args(param)")
	public void addSignTask(AddSignParam param) {}			

}
```

My advices:

```
 package com.chamc.boot.bpm.controller.advice;

import java.util.List;

import org.aspectj.lang.annotation.Aspect;
import org.aspectj.lang.annotation.Before;
import org.springframework.beans.factory.InitializingBean;
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.core.annotation.AnnotationAwareOrderComparator;
import org.springframework.stereotype.Component;

import com.chamc.boot.bpm.controller.listener.AddSignListener;
import com.chamc.boot.bpm.model.param.AddSignParam;

@Aspect @Component
public class AddSignTaskAdivice implements InitializingBean {

	private @Autowired(required = false) List<AddSignListener> addSignListeners;
	
	@Before("com.chamc.boot.bpm.config.Pointcuts.addSignTask(param)")
	public void beforAddSign(AddSignParam param) {
		if(this.addSignListeners != null) {
			this.addSignListeners.forEach(l -> l.before(param));
		}
	}

	@Override
	public void afterPropertiesSet() throws Exception {
		if(this.addSignListeners != null) {
			AnnotationAwareOrderComparator.sort(addSignListeners);
		}
	}
	
}
```

